var datePrice = __webpack_require__(3);

var nowDate = new Date(),
    year = nowDate.getFullYear(),
    month = nowDate.getMonth() + 1,
    priceMonth = $('#priceMonth'),
    priceYear = $('#priceYear');

function getDatePrice(m, y) {

    var dateArr = datePrice(m, y),
        len = dateArr.length,
        html = '';

    for (var i = 0; i < len; i++) {
        html += '<tr>';
        for (var j = 0; j < dateArr[i].length; j++) {
            if (dateArr[i][j].num) {
                html += '<td><p>' + dateArr[i][j].num + '</p></td>';
            } else {
                html += '<td></td>';
            }
        }
        html += '</tr>';
    }

    $('#priceDay').html(html);
    $('#littlePriceDay').html(html);
    priceMonth.text(m);
    priceYear.text(y);
}

function getLittleDatePrice(m, y) {
    var dateArr = datePrice(m, y),
        len = dateArr.length,
        html = '';

    for (var i = 0; i < len; i++) {
        html += '<tr>';
        for (var j = 0; j < dateArr[i].length; j++) {
            if (dateArr[i][j].num) {
                html += '<td><p>' + dateArr[i][j].num + '</p></td>';
            } else {
                html += '<td></td>';
            }
        }
        html += '</tr>';
    }

    $('#littlePriceDay').html(html);
    priceMonth.text(m);
    priceYear.text(y);
}
getLittleDatePrice(month, year);
getDatePrice(month, year);


var days = $('#days');
days.click(function(e){
    e.stopPropagation();
    $(this).addClass('on');
})

$(document).click(function(e){
    e.stopPropagation();
    if(days.hasClass('on')){
        days.removeClass('on');
    }
})


